import React, { Component } from 'react';

class Social extends Component {
    render() {
        return (
            <div class="social">
            <div class="btnsame btn1">
				<a href="https://github.com/besttodd" target="_blank"><i class="fa fa-github"></i></a>
			</div>
			<div class="btnsame btn2">
				<a href="https://twitter.com/@besttodd" target="_blank"><i class="fa fa-twitter"></i></a>
			</div>
			<div class="btnsame btn3">
				<a href="https://linkedin.com/in/todd-best-2b267860" target="_blank"><i class="fa fa-linkedin"></i></a>
			</div>
            </div>
            )
        }
    }
    
export default Social
